import './App.css';

function App() {
  const title = 'Welcome to our website';
  let visits = 60;
  const link = 'https://www.google.com'
  return (
    <div className="App">
      <div className="Content">
        <h2>{title}</h2>
        <p> It has been visited {visits} times</p>
        <a href={link}> Google </a>
      </div>
    </div>
  );
}

export default App;
